package com.vipin.algorithms.collections;

import java.util.Arrays;

public class SortString {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String[] s = { "9", "93","99", "91", "900"};
		Arrays.sort(s);
		for(String s1 : s) {
			System.out.println(s1);
		}
	}

}
